    return ( 
        <div className="navbar">
            <h1>StartUp</h1>
            <div className="links">
            <a href="/" className="signup">
                Sign Up
            </a>
            <a href="/" className="signin">
                Sign In
            </a>
            </div>
        </div>
     );
}

export default Navbar;
